import React from "react";
import Main from "./Component/Main";
import { BrowserRouter,Routes,Route } from "react-router-dom";

function App() {
  return (
  <>
  <BrowserRouter>
  <Routes>
    <Route exact path="/" element={<Main/>}/>
  </Routes>
  </BrowserRouter>
  </> 

  );
}

export default App;
